export async function getServerSideProps() {
  const { data } = await axios.get("https://rickandmortyapi.com/api/character");
  return {
    props: { characters: data.results },
  };
}

function Home(props) {
  console.log("props:", props);
  return (
    <h1>
      {props.characters.map((char) => (
        <img src={char.image} />
      ))}
    </h1>
  );
}

export default Home;
